DROP PROCEDURE IF EXISTS insertSpace;
DELIMITER $$
CREATE PROCEDURE `insertSpace`()
BEGIN
DECLARE i int default 1;
	WHILE i <= 2500 DO
		IF i <= 500 THEN
			INSERT INTO `Space`(idSpaceType) VALUES (1);
            SET i = i + 1;
        ELSE 
			INSERT INTO `Space`(idSpaceType) VALUES (2);
			SET i = i + 1;
		END IF;
	END WHILE;
END$$
