DROP FUNCTION IF EXISTS FnFindAvailableSpaces;
DELIMITER |
CREATE FUNCTION `FnFindAvailableSpaces`(p_idSpaceType int)
RETURNS int
READS SQL DATA
DETERMINISTIC
BEGIN
    DECLARE subSpaces int;
    DECLARE spaces int;
    DECLARE occSpaces int; 
    DECLARE availableSpaces int;
    
    SELECT COUNT(*) INTO subSpaces
    FROM Subscription sub inner join Space spa
    ON sub.idSpace = spa.idSpace
    WHERE spa.idSpaceType = p_idSpaceType;
    
    SELECT COUNT(*) INTO occSpaces
    FROM Occasional occ inner join Space spa
    ON occ.idSpace = spa.idSpace
    WHERE occ.endDate is NULL && spa.idSpaceType = p_idSpaceType;
    
    SELECT COUNT(*) INTO spaces
    FROM Space spa
    WHERE spa.idSpaceType = p_idSpaceType;
    
    SET availableSpaces = spaces - (subSpaces + occSpaces);
    
Return availableSpaces;
END |
DELIMITER ;

DROP PROCEDURE IF EXISTS showAvailableSpaces;
DELIMITER $$
CREATE PROCEDURE `showAvailableSpaces`()
BEGIN
select FnFindAvailableSpaces(1) + FnFindAvailableSpaces(2) as 'Available spaces', FnFindAvailableSpaces(1) as 'Avaible spaces outdoor', FnFindAvailableSpaces(2) as 'Available spaces indoor';
END$$
DELIMITER ;
